import react, { useState } from 'react';
import wordsList from './wordsList.css';

const WordsList = ({ wordsList }) => {
    return (
        <div className="wordsList">
            <h2>영단어 목록</h2>
            {wordsList.map(item => {
                return (
                <ol key={item.id}>
                    <li>{item.id}. </li>
                    <li>{item.english} </li>
                    <li>{item.korean}</li>
                </ol>
                )
            })}
        </div>
    );
};

export default WordsList;
